    <div>
       <button onClick={() =>{setNewCount((nc) => nc + 1)}}>GrandParent Count - {newCount}</button>
       <Parent1 newCount={newCount}>
            <Child1 />
       </Parent1>
    </div>
  )
}

export default GrandParent
